css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("www.tokywoky.com") {
  body {
    background-image:url(http://hdlost.net/wallpapers/contexte-couleurs-2560x1600.jpg);
    background-attachment: fixed;
  }
  .navLink {
    float: right;
    margin: 0;
    font-family: 'Segoe UI';
    font-size: 16px;
    color: #00b0f0;
    font-weight: lighter;
    -ms-word-wrap: break-word;
    word-wrap: break-word;
    cursor: pointer;
    padding: 10px 0 10px 20px;
    text-transform: uppercase;
    vertical-align: top;
  }
  .navContain {
    background-color: #f9f9f9;
  }
  .separator {
    border-top: 1px solid #333;
    margin: 20px 5px 30px 5px;
  }
  .feedSeeAnswersLink {
    cursor: pointer;
    font-family: 'Segoe UI';
    font-size: 13px;
    color: #331c8e;
    font-weight: bold;
    -ms-word-wrap: break-word;
    word-wrap: break-word;
    text-align: right;
  }
  .coachFeedTab.feedTabActive:visited {
    background-color: #f9f9f9
  }
   .newAnswerWarning {
    background-color: #f9f9f9
  }     
  .mainBarTitle {
    background-color: #f9f9f9
  }
  .c2c {
    background-color: #f9f9f9
  }
  .postContain {
    background-color: #f9f9f9
  }
  .answerContent {
    background-color: #f9f9f9
  }
  .sidebarContain {
    background-color: #f9f9f9
  }
  .statusSendContain {
    background-color:#f9f9f9
  }
  .statusContain {
    background-color: #f9f9f9
  }
  .statusCommentsContain {
    background-color: #f9f9f9
  }
  .statusCommentsMore .statusCommentsCta {
    background-color: #f9f9f9
  }
  .statusBottomCommentBox {
    background-color: #f9f9f9
  }
  .userDetailsMini {
    background-color: #f9f9f9
  }
  .statusPostImageBtn {
    background-color: #f9f9f9
  }
  .statusCommentImageBtn {
    background-color: #f9f9f9
  }
  .notificationsContainer {
    background-color: #f9f9f9
  }
  .indexAnswerInput {
    background-color: #dddbdb;
    color: #000
  }
  .navBarSiteTarget {
    visibility: hidden
  }  
  .tokyPeekTutorial {
    visibility: hidden
  }
  .profileTutoButton {
    visibility: hidden
  }
  .emojiPickerContain .emojiPickerButtonContain .emojiPickerButton {
     opacity: 100
  }   
  .feedAnswerCorrectionButton {
    visibility: hidden
  }
}
